import Axios from "axios";
import { API_URL } from '../../api/todo/Constants.js';

class TodoDataService {
    findAllTodo = () => {
        return Axios.get(`${API_UR}/users/todos`)
    }

    deleteTodoById = (id) => {
        return Axios.delete(`http://localhost:8080/delete/todos/${id}`)
    }

    editTodo = (id) => {
        return Axios.get(`http://localhost:8080/edit/todos/${id}`)
    }

    updateTodo = (id, todo) => {
        return Axios.put(`http://localhost:8080/update/todos/${id}`, todo)
    }

    postTodo = (todo) => {
        return Axios.post(`http://localhost:8080/post/todos`, todo)
    }

}

export default new TodoDataService()
